import React, { Component } from "react";
import { List, Card, Avatar, Row, Col, Typography, Progress } from "antd";
import "./App.css";
import IndividualSkill from "./indSkill.js";
const { Meta } = Card;
const { Title } = Typography;

export default class contactMe extends Component {
  render() {
    return (
      <div style={{ textAlign: "center" }}>
        <br />
        <Title level={4}>Contact Me</Title>
        <br />
        <img
          src="https://www.google.co.in/url?sa=i&source=images&cd=&ved=2ahUKEwjH--Lp9ITiAhWIL48KHURdDH8QjRx6BAgBEAU&url=https%3A%2F%2Fwww.flaticon.com%2Ffree-icon%2Ffacebook_124010&psig=AOvVaw36TeWJO8op2nD1DCImZwrb&ust=1557163662004152"
          width="50px"
        />
      </div>
    );
  }
}
